import React from "react";
import ReactDOM from "react-dom";
import OpticMap from "./OpticMap";
import "./index.css";

const App = () => (
  <div>
    <div className="navigationBar"></div>
    <OpticMap />
  </div>
);

ReactDOM.render(<App />, document.getElementById("root"));
